import React, { useState, useEffect } from 'react';
import { useParams, useNavigate } from 'react-router-dom';
import { updateSongById, getSongById } from '../../Api/SongApi';

const EditSong = () => {
    const { songId } = useParams();
    const navigate = useNavigate();
    const [song, setSong] = useState({
        title: '',
        soundtrackFile: null,
        imageFile: null,
        genreId: '',
        privacy: 'public',
        releaseDate: '',
    });

    const genreToIntMap = {
        Workout: 0,
        Relaxation: 1,
        Party: 2,
        StudyFocus: 3,
        MoodBooster: 4,
        Chill: 5,
        Travel: 6,
        Morning: 7,
        Nighttime: 8,
        Throwback: 9,
        LoveSongs: 10,
        SadSongs: 11,
        Jazz: 12,
        Classical: 13,
        Indie: 14,
        Rock: 15,
        Pop: 16,
        HipHopRap: 17,
        Electronic: 18,
        RandBSoul: 19,
    };

    const intToGenreMap = Object.keys(genreToIntMap).reduce((obj, key) => {
        obj[genreToIntMap[key]] = key;
        return obj;
    }, {});

    useEffect(() => {
        const fetchSong = async () => {
            try {
                const songData = await getSongById(songId);
                setSong({
                    title: songData.title,
                    imageFile: songData.imageFileName,
                    soundtrackFile: songData.soundTrackFileName,
                    releaseDate: songData.releaseDate,
                    genreId: songData.nameOfGenre,
                    privacy: songData.privacy ? 'public' : 'private',
                });
            } catch (error) {
                console.error('Error fetching song:', error);
            }
        };

        fetchSong();
    }, [songId]);

    const handleChange = (event) => {
        const { name, value } = event.target;
        setSong({ ...song, [name]: value });
    };

    const handleSubmit = async (event) => {
        event.preventDefault();

        const formData = new FormData();
        formData.append('title', song.title);
        formData.append('genreId', song.genreId);
        formData.append('privacy', song.privacy === "public" ? true : false);
        // Append other fields if needed

        try {
            await updateSongById(songId, formData);
            alert('Song updated successfully');
            navigate('/ListSong');
        } catch (error) {
            console.error('Error updating the song:', error);
        }
    };

    return (
        <div className="edit-song-page">
            <h2>Edit Song</h2>
            <form onSubmit={handleSubmit} className="edit-song-form">
                <div>
                    <label>Title:</label>
                    <input type="text" name="title" value={song.title} onChange={handleChange} />
                </div>
                <div>
                    <label>Image:</label>
                    <img src={song.imageFile} alt="Song Image" style={{ maxWidth: '100px' }} />
                </div>
                <div>
                    <label>Soundtrack:</label>
                    <audio controls>
                        <source src={song.soundtrackFile} type="audio/mpeg" />
                        Your browser does not support the audio element.
                    </audio>
                </div>
                <div>
                    <label>Release Date:</label>
                    <input type="text" name="releaseDate" value={song.releaseDate} readOnly />
                </div>
                <div>
                    <label>Genre:</label>
                    <input type="text" value={intToGenreMap[song.genreId]} readOnly />
                </div>
                <div>
                    <label>Privacy:</label>
                    <select name="privacy" value={song.privacy} onChange={handleChange}>
                        <option value="public">Public</option>
                        <option value="private">Private</option>
                    </select>
                </div>
                <button type="submit">Save Changes</button>
            </form>
        </div>
    );
};

export default EditSong;
